  .content{ position:relative; z-index:2; text-align:center; padding:22px 14px 6px; }
  .tag{ color:var(--gold); letter-spacing:.12em; text-transform:uppercase; font-size:12px; }
  h1{ margin:.2em 0; font-size: clamp(28px, 4.5vw, 44px); }
  p.sub{ margin:0; color:var(--muted); font-style:italic; font-size: clamp(14px, 2.8vw, 18px); }
  .panel{ display:flex; flex-wrap:wrap; gap:10px; justify-content:center; padding:14px 10px 10px; }
  .tile{ min-width:96px; text-align:center; background: rgba(5,8,12,.65);
          border:1px solid rgba(255,255,255,.08); padding:12px 16px; border-radius:12px; backdrop-filter: blur(3px); }
  .num{ font-variant-numeric: tabular-nums; font-size: clamp(32px,6vw,48px); line-height:1.05; }
  .lab{ color:var(--muted); font-size:12px; letter-spacing:.4px; text-transform:uppercase; margin-top:2px; }
  .tagline{ color:var(--gold); font-size: clamp(14px, 2.6vw, 18px); letter-spacing:.08em; text-transform:uppercase;
             margin: 6px 0 16px; }
</style>
</head>
<body>
  <main class="wrap" role="article" aria-label="Khaz Modan Ark Countdown">
    <div class="bg" aria-hidden="true"></div>
    <div class="veil" aria-hidden="true"></div>
    <div class="content">
      <div class="tag">Khaz Modan Expedition</div>
      <h1>The Mists Await</h1>
      <p class="sub">
        Departure across the Veil at <span id="deadlineStr">Nov&nbsp;1, 2025 5:30&nbsp;PM</span> (Pacific)
      </p>
      <section class="panel" aria-live="polite" aria-atomic="true">
        <div class="tile"><div id="d" class="num">0</div><div class="lab">Days</div></div>
        <div class="tile"><div id="h" class="num">0</div><div class="lab">Hours</div></div>
        <div class="tile"><div id="m" class="num">0</div><div class="lab">Minutes</div></div>
        <div class="tile"><div id="s" class="num">0</div><div class="lab">Seconds</div></div>
      </section>
      <div class="tagline">A New World Awaits</div>
    </div>
  </main>

<script>
  // UTC-anchored instant: Nov 1, 2025 5:30 PM Pacific == Nov 2, 2025 00:30:00 UTC
  const TARGET_EPOCH = Date.UTC(2025, 10, 2, 0, 30, 0); // (month is 0-based)

  // Friendly Pacific string (handles DST automatically for that date)
  document.getElementById('deadlineStr').textContent =
    new Intl.DateTimeFormat([], {
      timeZone:'America/Los_Angeles', month:'short', day:'numeric', year:'numeric', hour:'numeric', minute:'2-digit'
    }).format(new Date(TARGET_EPOCH));

  const el = { d: document.getElementById('d'),
               h: document.getElementById('h'),
               m: document.getElementById('m'),
               s: document.getElementById('s') };

  function tick(){
    const now = Date.now();
    let diff = Math.max(0, TARGET_EPOCH - now);
    const sec = Math.floor(diff/1000);
    const days = Math.floor(sec/86400);
    const hours = Math.floor((sec % 86400)/3600);
    const mins = Math.floor((sec % 3600)/60);
    const secs = sec % 60;
    el.d.textContent = String(days);
    el.h.textContent = String(hours).padStart(2,'0');
    el.m.textContent = String(mins).padStart(2,'0');
    el.s.textContent = String(secs).padStart(2,'0');
  }
  tick(); setInterval(tick,1000);
</script>
</body>
</html>
